import './styles/App.css';
import Layout from './components/layout/layout';
import Home from './views/home';
import About from './views/about';

function App() {
  return (
    <Layout>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
    </Routes>
    </Layout>
  );
}

export default App;
